def lengthOfLongestSubstring(s):
    s=np.array(list(s))
    unique=np.unique(s)
    print(len(unique))
    i=0
    longest=0
    while i <len(s):
        idx_next=i+1
        for j in range(len(unique)):
            if i+j+1>len(s):
                return longest
            sub_s=s[i:i+j+1]
            values, counts = np.unique(sub_s, return_counts=True)
            mask=counts!=1
            if np.any(mask):
                break
            if len(sub_s)>longest:
                longest=len(sub_s)
                if len(unique)==longest:
                    return longest
        i=idx_next
    return longest
